// src/sections/Contact/Contact.jsx
import React from "react";
import styles from "./Contact.module.css";
import {
  FaFacebookF, FaInstagram, FaLinkedinIn, FaGithub, FaTwitter,
  FaPhoneAlt, FaEnvelope, FaMapMarkerAlt
} from "react-icons/fa";

const Contact = () => {
  return (
    <section id="contact" className={styles.contact}>
      <div className={styles.container}>
        <div className={styles.left}>
          <h2>Contact Us</h2>
          <p>Weâ€™d love to hear from you. Reach out via any method below.</p>
          <ul className={styles.contactInfo}>
            <li><FaMapMarkerAlt /><span>Startups Valley TBI, Amal Jyothi College of Engineering, Koovappally, Kerala 686518</span></li>
            <li><FaPhoneAlt /><span>+91 9988776655</span></li>
            <li><FaEnvelope /><span>support@netscorp.in</span></li>
          </ul>
          <div className={styles.socials}>
            <a href="https://facebook.com" target="_blank" rel="noreferrer" aria-label="Facebook"><FaFacebookF /></a>
            <a href="https://instagram.com" target="_blank" rel="noreferrer" aria-label="Instagram"><FaInstagram /></a>
            <a href="https://linkedin.com" target="_blank" rel="noreferrer" aria-label="LinkedIn"><FaLinkedinIn /></a>
            <a href="https://github.com" target="_blank" rel="noreferrer" aria-label="GitHub"><FaGithub /></a>
            <a href="https://twitter.com" target="_blank" rel="noreferrer" aria-label="Twitter"><FaTwitter /></a>
          </div>
        </div>

        <div className={styles.right}>
          <iframe
            title="Location"
            src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d13156.900271933364!2d76.81802239999999!3d9.528361799999999!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e1!3m2!1sen!2sin!4v1747849589035!5m2!1sen!2sin"
            className={styles.map}
            allowFullScreen=""
            loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"
          ></iframe>
        </div>
      </div>
    </section>
  );
};

export default Contact;
